('node', 'page', 0, 10, 10, 'und', 0, '<div class="image-about-us"><img alt="img_about_us" src="/drupal7/fiddle/sites/default/files/images/img_about_us.jpg" /></div>\r\n<p><a href="http://www.suninmyheart.com/">Sun In My Heart</a> are a private non-profit organization working to bring new life and hope to the homeless, orphaned, and poor children of Vietnam.</p>\r\n<p>Even before forming the Vietnam&#39;s Orphanage Fund, we have been helping orphans, homeless and impoverished children in Vietnam. &nbsp;Both as individuals and through the help of friends we have brought money, food and clothes, books and school supplies to the needy children of Vietnam.</p>\r\n<p>Vietnam&#39;s Orphanage Fund seeks to support each child in as many ways as their age and situation requires. We hope the information from our website will be useful for you to help the poor and orphaned children in Vietnam.</p>\r\n<h3>About the founder</h3>\r\n<p>Kim McCluskey&rsquo;s lifetime spiritual commitment is to help others, especially children. His commitment to helping children began in the sixties when he was an 18-year-old Marine stationed in Vietnam. Even though he later received the Purple Heart for his service, he always felt the war was wrong, that the American people had been lied to, and that the people of Vietnam were good, gentle people.&nbsp;</p>\r\n<p>After he came home from the war, he became a hippie with a long blonde pony tail and a Volkswagen bus. He began to meditate as he tried to learn about loving kindness, compassion and God. &nbsp; In his thirties, he raised three children and became a chiropractor. In his fifties, responding to his passion for nature, adventure and paddling, he sold his chiropractic practice and began to guide paddling trips to remote places all over the world. &nbsp; His business is &ldquo;Worldwide Paddling Adventures,&rdquo; and the website is <a href="http://www.funtripper.com/" title="www.funtripper.com">www.funtripper.com</a>. &nbsp;In his spiritual practice, he came to believe that we are all one and that we must work constantly to love one another.</p>\r\n<p>When he took groups paddling on the bays of Vietnam, he was reunited with the Vietnamese people, who had seemed so gentle to him as a young Marine. On one of these trips, he discovered three young girls living alone on a plastic raft, abandoned by their father. As a father, he could not tolerate the girls&rsquo; predicament. His quest to help the three was the beginning of the &ldquo;Sun in My Heart&rdquo; charity. First he was able to build a house for the girls, all of whom are now doing very well. Then, with the money left over, he figured out how to build schools for small children left out of the mainstream schools of Vietnam.</p>\r\n<p>The children in the schools built by &ldquo;Sun in My Heart&rdquo; are poor, minority children who do not speak the standard Vietnamese language. These schools are like &ldquo;Headstart&rdquo; in the U.S., in which minority children get pre-reading and pre-math skills that level the playing field and allow these minority children to achieve academic and personal success. They also learn music and about science and nature.</p>\r\n<p>Kim now lives with his sweetheart Jeanie in a log home in the remote woods of far northern Minnesota, about 10 miles from the Canadian border. &nbsp; They like paddling the local lakes, taking long hikes, and Kim enjoys drinking cup after cup of good Vietnamese green tea. He travels to Vietnam often and hears often from his Vietnamese friends.</p>\r\n', '', 'full_html'),
