(10, 'node', ' about us sun in my heart are a private nonprofit organization working to bring new life and hope to the homeless orphaned and poor children of vietnam even before forming the vietnam s orphanage fund we have been helping orphans homeless and impoverished children in vietnam both as individuals and through the help of friends we have brought money food and clothes books and school supplies to the needy children of vietnam vietnam s orphanage fund seeks to support each child in as many ways as their age and situation requires we hope the information from our website will be useful for you to help the poor and orphaned children in vietnam about the founder kim mccluskey s lifetime spiritual commitment is to help others especially children his commitment to helping children began in the sixties when he was an 18yearold marine stationed in vietnam even though he later received the purple heart for his service he always felt the war was wrong that the american people had been lied to and that the people of vietnam were good gentle people after he came home from the war he became a hippie with a long blonde pony tail and a volkswagen bus he began to meditate as he tried to learn about loving kindness compassion and god in his thirties he raised three children and became a chiropractor in his fifties responding to his passion for nature adventure and paddling he sold his chiropractic practice and began to guide paddling trips to remote places all over the world his business is worldwide paddling adventures and the website is wwwfuntrippercom  in his spiritual practice he came to believe that we are all one and that we must work constantly to love one another when he took groups paddling on the bays of vietnam he was reunited with the vietnamese people who had seemed so gentle to him as a young marine on one of these trips he discovered three young girls living alone on a plastic raft abandoned by their father as a father he could not tolerate the girls predicament his quest to help the three was the beginning of the sun in my heart charity first he was able to build a house for the girls all of whom are now doing very well then with the money left over he figured out how to build schools for small children left out of the mainstream schools of vietnam the children in the schools built by sun in my heart are poor minority children who do not speak the standard vietnamese language these schools are like headstart in the us in which minority children get prereading and premath skills that level the playing field and allow these minority children to achieve academic and personal success they also learn music and about science and nature kim now lives with his sweetheart jeanie in a log home in the remote woods of far northern minnesota about 10 miles from the canadian border they like paddling the local lakes taking long hikes and kim enjoys drinking cup after cup of good vietnamese green tea he travels to vietnam often and hears often from his vietnamese friends  ', 0),
